import React from "react";

function Card(porps) {

    return(
        <div className="bg-white p-3 rounded-3">
            <img className="rounded-2" src="https://picsum.photos/200" alt=""></img>
            <h1 className="fs-4">Mahmoud hussain</h1>
            <h3 className="fs-6">Web Desiner</h3>
            <ul className="fs-">
                <li>Phone : +212 657 89654</li>
                <li>Email : mahmoudhussain@gmail.com</li>
                <li>WebSite : mahmoud.com</li>
            </ul>

        </div>
    );


}

export default Card;
